import Link from 'next/link'

export function MainLayout ({children}) {
    return (
        <>
            <nav>
                <p><Link href={'/'}><a>Home</a></Link></p>
                <p><Link href={'/cards'}><a>Cards</a></Link></p>
                <p><Link href='/auth'><a>Auth</a></Link></p>
            </nav>
            <main>
                {children}
            </main>
        </>
    )
}
